00569                 using pack_type         = typename utility::pack2array<Ints_type...>;
00570                 using unique_type = typename pack_type::elem_type;
00571                 constexpr std::size_t pack_sz{pack_type::pack_size()};
00572                 if constexpr ( type_traits::unsigned_integral_c<unique_type> ) {
00573                         if constexpr (type_traits::is_unsigned_sz_gt_v<UINT_T,unique_type>) {
00574                                         using SUInt_type = type_traits::sig_UInt_for_UInt_t<UINT_T>;
00575                                         std::array<SUInt_type,L> ret_array{digits_pow_i...};
00576                                         base_t ret{};
00577                                         for(std::size_t ix{0} ; ix < pack_sz ; ++ix) {
00578                                                 ret[ix] = dig_t(ret_array[ix]);
00579                                         }
00580                                         for(std::size_t ix{pack_sz} ; ix < L ; ++ix) {
00581                                                 ret[ix] = dig_0();
00582                                         }
00583                                         return ret;
00584                         }
00585                         else {
00586                                         using SUInt_type = type_traits::sig_UInt_for_UInt_t<unique_type>;
00587                                         std::array<SUInt_type,L> ret_array{digits_pow_i...};
00588                                         base_t ret{};
00589                                         for(std::size_t ix{0} ; ix < pack_sz ; ++ix) {
00590                                                 ret[ix] = dig_t(ret_array[ix]);
00591                                         }
00592                                         for(std::size_t ix{pack_sz} ; ix < L ; ++ix) {
00593                                                 ret[ix] = dig_t(0);
00594                                         }
00595                                         return ret;
00596                         }
00597                 }
00598                 else {
00599                         using temp_SUInt_type = type_traits::sig_UInt_for_SInt_t<unique_type>;
00600                         if constexpr (type_traits::is_unsigned_sz_gt_v<UINT_T,temp_SUInt_type>)
00601                         {
00602                                         using SUInt_type = type_traits::sig_UInt_for_UInt_t<UINT_T>;
00603                                         std::array<SUInt_type,L> ret_array{digits_pow_i...};
00604                                         base_t ret{};
00605                                         for(std::size_t ix{0} ; ix < pack_sz ; ++ix) {
00606                                                 if (ret_array[ix] < 0)
00607                                                         ret[ix] = dig_t((((ret_array[ix]/(-B))+1)*B)+ret_array[ix]);
00608                                                 else
00609                                                         ret[ix] = dig_t(ret_array[ix]);
00610                                         }
00611                                         for(std::size_t ix{pack_sz} ; ix < L ; ++ix) {
00612                                                 ret[ix] = dig_0();
00613                                         }
00614                                         return ret;
00615                         }
00616                         else {
00617                                         using SUInt_type = temp_SUInt_type;
00618                                         std::array<SUInt_type,L> ret_array{digits_pow_i...};
00619                                         base_t ret{};
00620                                         for(std::size_t ix{0} ; ix < pack_sz ; ++ix) {
00621                                                 if (ret_array[ix] < 0)
00622                                                         ret[ix] = dig_t((((ret_array[ix]/(-B))+1)*B)+ret_array[ix]);
00623                                                 else
00624                                                         ret[ix] = dig_t(ret_array[ix]);
00625                                         }
00626                                         for(std::size_t ix{pack_sz} ; ix < L ; ++ix) {
00627                                                 ret[ix] = dig_0();
00628                                         }
00629                                         return ret;
00630                         }
00631                 }
00632         }
