00697         template<type_traits::integral_c Int_Type>
00698         constexpr inline int_reg_digs_t & operator = (Int_Type&& arg) noexcept {
00699                 Int_Type creg_g{std::forward(arg)};
00700                 if ((&(this->m_dc()))!=(&arg)) {
00701                         uint128_t BasePowIx{1};
00702                         for(std::size_t k{0u} ; k < L ; ++k) {
00703                                 BasePowIx *= B;
00704                         }
00705                         while (creg_g < 0) {
00706                                 creg_g += BasePowIx;
00707                         }
00708                         for(std::size_t k{0u} ; k < L ; ++k){
00709                                 m_dc[k] = dig_t(creg_g);
00710                                 creg_g /= B;
00711                         }
00712                 }
00713                 return (*this);
00714         }
