01151         constexpr inline
01152         const int_reg_digs_t & operator ++ ()
01153         noexcept {
01154                 int_reg_digs_t& cthis(*this);
01156                 dig_t carry{dig_1()};
01158                 for(std::size_t ix{0} ; ix < L-1 ; ++ix) {
01159                         if ((cthis[ix]==dig_Bm1())&&(carry == dig_1())) {
01160                                 cthis[ix]=dig_0();
01161                                 carry = dig_1();
01162                         }
01163                         else if ((cthis[ix]<dig_Bm1())&&(carry == dig_1())){
01164                                 if (carry != dig_0()) {
01165                                         ++cthis[ix];
01166                                         // carry = dig_0();
01167                                         break;
01168                                 }
01169                         }
01170                 }
01171                 return cthis;
01172         }
