01292         constexpr inline
01293         const int_reg_digs_t & operator += (dig_t arg)
01294         noexcept {
01295                 int_reg_digs_t& cthis(*this);
01297                 dig_t carry{arg};
01304                 if (arg==dig_0()) {
01305                         return (cthis);
01306                 } else if (arg == dig_1()) {
01307                         return (++cthis);
01308                 } else {
01309                         const dig_t dig_BmArg{dig_Bm1()-(arg-dig_1())};
01311                         if (cthis[0]==dig_BmArg) {
01312                                 cthis[0] = dig_0();
01313                                 carry    = dig_1();
01314                         }
01317                         for(std::size_t ix{1} ; ix < L-1 ; ++ix) {
01318                                 if (cthis[ix]==dig_Bm1()&& !(carry.is_0())) {
01319                                         cthis[ix]=dig_0();
01320                                         carry = dig_1();
01321                                 }
01322                                 else if ((cthis[ix]<dig_Bm1())&&(carry == dig_1())){
01323                                         if (carry != dig_0()) {
01324                                                 ++cthis[ix];
01325                                                 break;
01326                                         }
01327                                 }
01328                         }
01329                         return cthis;
01330                 }
01331         }
