01334         const int_reg_digs_t & operator -= (dig_t arg)
01335         noexcept {
01336                 int_reg_digs_t& cthis(*this);
01338                 dig_t carry{arg};
01345                 if (arg==dig_0()) {
01346                         return (cthis);
01347                 } else if (arg == dig_1()) {
01348                         return (--cthis);
01349                 } else {
01350                         const dig_t dig_CBArg{arg.C_B()};
01351                         const dig_t dig_sig_Arg{dig_Bm1()};
01352 
01354                         if (cthis(0)+dig_CBArg()>dig_Bm1()()) {
01355                                 carry = dig_1();
01356                         } else {
01357                                 carry = dig_0();
01358                         }
01359                         cthis[0] += dig_CBArg;
01360 
01363                         for(std::size_t ix{1} ; ix < L-1 ; ++ix) {
01364                                 if (cthis[ix].is_0() && carry.is_0()) {
01365                                         cthis[ix]=dig_Bm1();
01366                                         carry = dig_0();
01367                                 }
01368                                 else if (cthis[ix].is_0() && !carry.is_0()) {
01369                                         cthis[ix]=dig_0();
01370                                         carry = dig_1();
01371                                 }
01372                                 else if (cthis[ix].is_1() && carry.is_0()) {
01373                                         cthis[ix]=dig_0();
01374                                         carry = dig_1();
01375                                 }
01376                                 else {
01377                                         cthis[ix] += dig_Bm1();
01378                                         cthis[ix] += carry;
01379                                         carry = dig_1();
01380                                 }
01381                         }
01382                         return cthis;
01383                 }
