01388         constexpr inline
01389         std::array<int_reg_digs_t,2> mult(dig_t arg) const
01390         noexcept {
01391                 int_reg_digs_t cpthis(*this);
01392                 std::array<int_reg_digs_t,2> ret{};
01393                 if (arg.is_0()) {
01394                         cpthis = ret[0];
01395                         return ret;
01396                 }
01397                 else if (arg.is_1()) {
01398                         ret[0] = cpthis;
01399                         return ret;
01400                 }
01401                 else {
01402                         dig_t carry{dig_0()};
01403                         for(std::size_t ix{0} ; ix < L ; ++ix){
01404                                 const auto res = cpthis[ix].mult(arg);
01405                                 const auto uds = res[0].add(carry);
01406                                 ret[0][ix] = cpthis[ix] = uds[0] + carry;
01407                                 carry = res[1] + uds[1];
01408                         }
01409                         ret[1][0]=carry;
01410                         return ret;
01411                 }
01412         }
