01416         std::array<int_reg_digs_t,2> full_euclid_div(dig_t dsor) {
01417                 const int_reg_digs_t & dndo{*this};
01418                 std::array<int_reg_digs_t,2> ret{};
01419                                                 if (dsor == dig_0()) {
01420                                 return ret;
01421                 }
01422                 else    if (dsor == dig_1()) {
01423                         ret[0] = dndo;
01424                         ret[1] = regd_0();
01425                         return ret;
01426                 }
01427                 else    if (dndo < regd_B()) {
01428                         ret[0] = dndo[0] / dsor;
01429                         ret[1] = dndo[0] % dsor;
01430                         return ret;
01431                 }
01432                 else {
01433                         int_reg_digs_t& coc{ret[0]};
01434                         int_reg_digs_t& rem{ret[1]};
01435                         for(std::int64_t lx{L-1} ; lx > -1 ; --lx) {
01436                                 if (dndo[lx]>=dsor) {
01437                                         coc << 1;
01438                                         coc[0] = dndo[lx]/dsor;
01439                                         rem[0] = dndo[lx]%dsor;
01440                                         rem << 1;
01441                                         rem[0] = dndo[lx-1];
01442                                 }
01443                                 else {
01444                                         rem << 1;
01445                                         rem[0] = dndo[lx-1];
01446                                         for (UINT_T int_coc{0}; int_coc < B ; ++int_coc) {
01447                                                 auto X{dig_t(int_coc).mult(dsor)};
01448                                                 int_reg_N_digs_t<2> prod{X[1],X[0]};
01449                                                 if (prod >= rem) {
01450                                                         rem -= prod;
01451                                                         rem << 1;
01452                                                         rem[0] = dndo[lx-2];
01453                                                         coc << 1;
01454                                                         coc[0] = dig_t(int_coc);
01455                                                         break;
01456                                                 }
01457                                         }
01458                                 }
01459                         }
01460                         return ret;
01461                 }
01462         }
