01465         constexpr inline
01466         std::array<int_reg_digs_t,2> add(dig_t arg) const
01467         noexcept {
01468                 const int_reg_digs_t& cthis{*this};
01469                 std::array<int_reg_digs_t,2> result{dig_0(),cthis};
01470                 dig_t carry{dig_0()};
01471                 for(std::size_t ix{0} ; ix < L ; ++ix) {
01472                         auto    temp_result   =      result[0][ix].add(arg);
01473                         auto  temp_result_2 = temp_result[0][ix].add(carry);
01474                         result[0][ix] = temp_result_2[0];
01475                         result[1][0]  = temp_result_2[1];
01476                         carry = result[1][0];
01477                 }
01478                 for(std::size_t ix{1} ; ix < L ; ++ix) {
01479                         result[1][ix] = dig_0();
01480                 }
01481                 return result;
01482         }
