01486         constexpr inline
01487         std::array<int_reg_digs_t,2> subst(dig_t arg) const
01488         noexcept {
01489                 const int_reg_digs_t& cthis{*this};
01490                 std::array<int_reg_digs_t,2> result{dig_0(),cthis};
01491                 int_reg_digs_t cb_arg{-arg};
01492                 if (!(arg.is_0())) {
01493                         for(std::size_t ix{1} ; ix < L ; ++ix) {
01494                                 cb_arg[ix] = dig_Bm1();
01495                         }
01496                 }
01497                 dig_t carry{dig_0()};
01498                 for(std::size_t ix{0} ; ix < L ; ++ix) {
01499                         auto    temp_result   =      result[0][ix].add(cb_arg[ix]);
01500                         auto  temp_result_2 =     temp_result[0].add(carry);
01501                         result[0][ix]  = temp_result_2[0];
01502                         result[1][ix]  = (temp_result_2[1].add(temp_result_2[1]))[0];
01503                         carry = result[1][ix];
01504                 }
01505                 return result;
01506         }
