01541                 constexpr inline
01542                 std::array<int_reg_digs_t,2> euclid_div (dig_t arg) const
01543                 noexcept {
01544                         const int_reg_digs_t& dndo{*this};
01545                         const dig_t&      dsor{arg};
01546                         const int_reg_digs_t<UINT_T,B,2> tmp_dsor{dig_0(),arg};
01547                                                 int_reg_digs_t<UINT_T,B,2> part_rem{dig_0(),dndo[L-1]};
01548                                                 int_reg_digs_t rem{regd_0()};
01549                                                 int_reg_digs_t coc{regd_0()};
01550                         if (dsor == dig_0()) {
01551                                 std::array<int_reg_digs_t,2> rem_coc{regd_0(),regd_0()};
01552                                 return rem_coc;
01553                         }
01554                         else if (dsor == dig_1()) {
01555                                 std::array<int_reg_digs_t,2> rem_coc{regd_0(),(*this)};
01556                                 return rem_coc;
01557                         }
01558                         else if ((dndo == regd_0())||(dndo == regd_1())) {
01559                                 std::array<int_reg_digs_t,2> rem_coc{(*this),regd_0()};
01560                                 return rem_coc;
01561                         }
01562                         else if (dndo < regd_B()) {
01563                                         dig_t retcoc{dndo[1]/dsor};
01564                                         dig_t retrem{dndo[1]%dsor};
01565                                         coc[0]=retcoc;
01566                                         rem[0]=retrem;
01567                                         return std::make_pair(rem,coc);
01568                         }
01569                         else {
01570                                 int_reg_digs_t<UINT_T,B,2> tmp_dsor{dig_0(),arg};
01571                                 std::int64_t ph_dndo{L-1};
01572                                 std::int64_t pl_dndo{L-1};
01573                                 // ph_dndo >= ix >= pl_dndo
01574                                 while((ph_dndo>-1)&&(pl_dndo>-1)) {
01575                                         if (pl_dndo == L-1) {
01576                                                 part_rem[1] = dig_0();
01577                                                 part_rem[0] = dndo[L-1];
01578                                         }
01579                                         else if ((pl_dndo == 0)&&(ph_dndo == 1)) {
01580                                                 part_rem[1] = dndo[1];
01581                                                 part_rem[0] = dndo[0];
01582                                         }
01583                                         else if ((pl_dndo == 0)&&(ph_dndo == 0)) {
01584                                                 part_rem[1] = dig_0();
01585                                                 part_rem[0] = dndo[0];
01586                                         }
01587                                         else if (ph_dndo > pl_dndo) {
01588                                                 part_rem[1] = dndo[ph_dndo];
01589                                                 part_rem[0] = dndo[pl_dndo];
01590                                         }
01591                                         else {
01592                                                 part_rem[1] = dig_0();
01593                                                 part_rem[0] = dndo[pl_dndo];
01594                                         }
01595 
01596                                         coc << 1;
01597                                         if (part_rem>=tmp_dsor) {
01598                                                 dig_t cocdig{dig_0()};
01599                                                 while(part_rem>=tmp_dsor) {
01600                                                         ++cocdig;
01601                                                         part_rem -= tmp_dsor;
01602                                                 }
01603                                                 coc |= cocdig;
01604                                                 if (ph_dndo > pl_dndo) {
01605                                                         --ph_dndo;
01606                                                         --pl_dndo;
01607                                                 }
01608                                                 else {
01609                                                         --pl_dndo;
01610                                                 }
01611                                         }
01612                                         else {
01613                                                 if (ph_dndo > pl_dndo) {
01614                                                         --ph_dndo;
01615                                                         --pl_dndo;
01616                                                 }
01617                                                 else {
01618                                                         --pl_dndo;
01619                                                 }
01620                                         }
01621                                 }
01622                                 rem[1]=part_rem[1];
01623                                 rem[0]=part_rem[0];
01624                                 std::array<int_reg_digs_t,2> rem_coc{std::make_pair(rem,coc)};
01625                                 return rem_coc;
01626                         }
01627                 }
