01959                 constexpr inline
01960                 int_reg_digs_t operator / (const int_reg_digs_t & arg) const
01961                 noexcept {
01962                         const int_reg_digs_t& dndo{*this};
01963                         const int_reg_digs_t& dsor{arg};
01964                         const std::int64_t num_0s_IZDA_dsor{cuenta_0s_desde_IZDA(dsor)};
01965                         const std::int64_t num_0s_IZDA_dndo{cuenta_0s_desde_IZDA(dndo)};
01966                         const std::int64_t MSDig_dsor{L-1-num_0s_IZDA_dsor};
01967                         const std::int64_t MSDig_dndo{L-1-num_0s_IZDA_dndo};
01968                         int_reg_digs_t rem{regd_0()};
01969                         int_reg_digs_t coc{regd_0()};
01970                         for(std::int64_t num_loops{0} ;
01971                                                                                         num_loops < std::abs(MSDig_dndo-MSDig_dndo)
01972                                                                                                                                          ; ++num_loops)
01973                         {
01974                                 if (MSDig_dsor > MSDig_dndo) {
01975                                         return regd_0();
01976                                 }
01977                                 else if (MSDig_dsor == MSDig_dndo) {
01978                                         for(std::int64_t ix{MSDig_dsor} ; ix > -1 ; --ix) {
01979                                                         if (dsor[ix] > dndo[ix]) {
01980                                                                 return regd_0();// DEVUELVE COCIENTE := 0 Y RESTO := DNDO
01981                                                         }
01982                                                         else if (dsor[ix] == dndo[ix]) {
01983                                                                 if (ix == 0)
01984                                                                         return regd_1();// DEVUELVE COCIENTE := 1 Y RESTO := 0
01985                                                                 else
01986                                                                         continue;
01987                                                         }
01988                                                         else {
01989                                                                 int_reg_digs_t coc{0};
01990                                                                 int_reg_digs_t idndo{dndo};
01991                                                                 int_reg_digs_t idsor{dsor};
01992                                                                 while (idndo >= idsor) {
01993                                                                         idndo -= idsor;
01994                                                                         ++coc[0];
01995                                                                 }
01996                                                                 return coc; // DEVUELVE COCIENTE := 000...L-1...0D
01997                                                                                                                 // SIENDO D EL DIGITO 0 (Y EL VALOR DE COCIENTE)
01998                                                                                                                 // DEVUELVE RESTO    := DNDO - DSOR * D
01999                                                         }
02000                                         }
02001                                 }
02002                                 else if (dsor == regd_1()) {
02003                                         return (*this);// DEVUELVE COCIENTE := DNDO Y RESTO := 0
02004                                 }
02005                                 else if (dsor == regd_0()) {
02006                                         return (*this);
02007                                 }
02008                                 else {
02009                                         std::int64_t pl_dndo{MSDig_dsor};
02010                                         std::int64_t ph_dndo{MSDig_dndo};
02011 
02012                                         // ph_dndo >= ix > pl_dndo
02013                                         for(std::int64_t ix{pl_dndo} ; ix <= ph_dndo ; ++ix) {
02014                                                 rem[ix-pl_dndo] = dndo[ix];
02015                                         }
02016 
02017                                         if (rem == dsor) {
02018                                                 return regd_1();// DEVUELVE COCIENTE:=1 Y RESTO:=0
02019                                         }
02020                                         else if (rem > dsor) {
02021                                                 dig_t coc_dig{dig_0()};
02022                                                 while(rem > dsor) {
02023                                                         ++coc_dig;
02024                                                         rem -= dsor;
02025                                                 }
02026                                                 coc *= regd_B();        // coc = coc * B
02027                                                 coc[0] = coc_dig; // coc = coc + D  ; B-1 >= D > 1
02028                                                 --pl_dndo;
02029                                                 for(std::int64_t ix{ph_dndo} ; ix > pl_dndo ; --ix) {
02030                                                         rem[ix-pl_dndo+1] = rem[ix-pl_dndo];
02031                                                 }
02032                                                 rem[pl_dndo] = dndo[pl_dndo];
02033                                                 --ph_dndo;
02034                                         }
02035                                         else {
02036                                                 if (pl_dndo != 0) {
02037                                                         --pl_dndo;
02038                                                         for(std::int64_t ix{ph_dndo} ; ix > pl_dndo ; --ix) {
02039                                                                 rem[ix-pl_dndo+1] = rem[ix-pl_dndo];
02040                                                         }
02041                                                         rem[pl_dndo] = dndo[pl_dndo];
02042                                                         coc *= regd_B(); // coc = coc * B
02043                                                         rem -= dsor;    // coc = coc + 0
02044                                                 }
02045                                                 else {
02046                                                         return coc;// DEVOLVEMOS LO CALCULADO EN COC Y EL RESTO ES REM
02047                                                 }
02048                                         }
02049                                 }
02050                         }
02051                         return coc;// NO SE DEBER√çA LLEGAR AQUI
02052                 }
