02054                 constexpr inline
02055                 int_reg_digs_t operator % (const int_reg_digs_t & arg) const
02056                 noexcept {
02057                         int_reg_digs_t ret(*this);
02058                         UINT_T retuds   = ret.m_dc[0]();
02059                         UINT_T retdecs  = ret.m_dc[1]();
02060                         UINT_T arguds   = arg.m_dc[0]();
02061                         UINT_T argdecs  = arg.m_dc[1]();
02062 
02063                         retuds  += (B*retdecs);
02064                         arguds  += (B*argdecs);
02065                         retuds  %= arguds;
02066                         retdecs  = retuds;
02067                         retdecs /= B;
02068                         retuds  %= B;
02069                         ret.m_dc[1]     = dig_t(retdecs);
02070                         ret.m_dc[0]     = dig_t(retuds);
02071                         return ret;
02072                 }
