02828                 enum estado_e {
02829                         e0ini   , e1r           , e1e           , e1g                   , e1sep         ,
02830                         e1d             , e1i           , e2g           , e2start       , e2dig         ,
02831                         e2dp    , e2end , e2B           , e3dig         , e0fin
02832                 };
02834                 std::string sds;
02836                 using inttype = typename type_traits::sig_UInt_for_UInt_t<Int_Type>;
02837                 using dig_t = dig_t<Int_Type,Base>;
02838                 using int_reg_digs_t = int_reg_digs_t<Int_Type,Base,Length>;
02840                 std::size_t     indice{0};
02842                 Int_Type                digito{0};
02843                 std::size_t longitud{0};
02844                 inttype                 numero_base_recogido{0};
02846                 int_reg_digs_t& numero_ret{arg};
02848                 estado_e est_act = e0ini;
