02988                                                 const bool dig_B_cdl {dig_c && c_es_dig_B && (longitud < Length-1)};
02989                                                 const bool rdig_B_cdl {dig_c && c_es_dig_B && dig_B_cdl};
02990                                                 if (rdig_B_cdl) {
