02998                                                         digito = 0;
02999                                                         longitud = 0;
03000                                                         numero_base_recogido = 0;
03001                                                         indice = 0;
03002                                                         numero_ret = int_reg_digs_t::regd_0();
03003                                                 }
03004                                         }
03005                                         break;
03006                                 case e2end :
03007                                         {
03008                                                 const bool c_es_sepfin {c == 'B'};
03009                                                 const bool d_es_digB {digito < Base};
03010                                                 const bool l_coincide {longitud == Length-1};// llega al cero ?
03011                                                 const bool rdigB_cdl {c_es_sepfin && d_es_digB && l_coincide};
03012                                                 if (rdigB_cdl) {
03013                                                         est_act = e2B;
03014                                                         numero_ret[Length-1-longitud] = dig_t(digito);
03015                                                         digito = 0;
