03024                                                 }
03025                                         }
03026                                         break;
03027                                 case e2B :
03028                                         {
03029                                                 if ((c >= '0')&&(c <= '9')) {
03030                                                         est_act = e3dig;
03031                                                         numero_base_recogido = c-'0';
03032                                                         digito = 0;
03033                                                 }
