03040                                                 }
03041                                         }
03042                                         break;
03043                                 case e3dig :
03044                                         {
03045                                                 const bool espacio_c {c < 16};
03046                                                 const bool digito_c {(c>='0') && (c<='9')};
03047                                                 const bool num_base_lt_Base {numero_base_recogido < Base};
03048                                                 const bool num_base_eq_Base {numero_base_recogido == Base};
03049                                                 if (digito_c && num_base_lt_Base) {
